import React  from "react";

const InputField = ({ value, label, name, placeholder, onChange }) => (
    <div className="form-group">
        <label>{label}:
            <input
            value={value}
            name={name}
            placeholder={placeholder}
            onChange={onChange}
        />
        </label>


    </div>
);

export default InputField;
